import React, { useEffect } from "react";
import axios from "axios";

const Logout = () => {
    useEffect(() => {
        const logout = async () => {
            try {
                // Make a request to your logout endpoint
                await axios.get("http://localhost:3001/logout");
                // Optionally show a logout message
                alert("You have been logged out");
            } catch (error) {
                console.error("Logout error:", error);
                // Handle logout error as needed
            }
        };

        logout(); // Call logout function when component mounts
    }, []); // Empty dependency array ensures it runs once on mount

    return <div>Logging out...</div>; // Optional message while logging out
};

export default Logout;
